import PostList from "../Components/PostList";
import { useState, useEffect } from "react";
import axios from 'axios';

const AllPosts = () => {
    const[posts, setPosts] = useState([])

    useEffect(() =>{
        axios
        .get("/allposts")
        .then((res)=>{
          console.log(res);
          setPosts(res.data);
        })
    },[])
    
    return ( 
       <PostList posts={posts} />
     );
}
 
export default AllPosts
;
